import React from "react";
import styled from "styled-components";

const Button = styled.button`
  background-color: black;
  color: white;
  font-size: 20px;
  padding: 10px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
`;

const Btn = () => {
  return (
    <div>
      <button>Click Me</button>
    </div>
  );
};

export default Btn;
